import React, {Component} from 'react';
import SearchBox from './SearchBox'
import CardList from './CardList'
import {robots} from './robots'

class App extends Component {
	constructor(){
		super()
		this.state = {
			robots: robots,
			searchfield: ''
		}
	}


	render() {
		return (
			<div className='tc'>
				<h1>RoboFriends</h1>
				<SearchBox />
				<CardList robotsInCard={robots}/>
			</div> 
		);
	}
};



export default App;
